import React, { useContext } from 'react'
import CartContext from '../store/CartContext'

export default function Cart(props) {

  const cartdata = useContext(CartContext)


  const cartItems = props.cartdata.map(item => <CartItem
                                                    id={item.id}
                                                    item={item} />)

  return (
    <div>
      {cartItems}


    </div>
  )
}
